public class Test_base64 {
	public static void main(String[] args) throws IOException, JpegProcessingException
	{	
		Test_base64 t = new Test_base64();
		t.test_base64_file();
	}
	
	public void test_img_base64() throws IOException
	{
//			File file = new File("D:\\ckjb_Request.pdf");
			File file = new File("红发.png");
			FileInputStream fin = new FileInputStream(file);
			byte[] by = new byte[2400];
			int size = 0;
			StringBuffer sbu = new StringBuffer();
			while((size = fin.read(by, 0, 24)) != -1)
			{
				byte[] x = new byte[size];
				System.arraycopy(by, 0, x, 0, size);
				sbu.append(Base64.encodeBase64String(x));
			}
			String str = sbu.toString();
			System.out.println(str);
			if(!Base64.isBase64(str))
				System.out.println("不是base64编码！！！");
			else
				System.out.println("是base64编码");
			BufferedImage bufImg = ImageIO.read(new ByteArrayInputStream(Base64.decodeBase64(str)));
			if (null == bufImg) {  
				System.out.println("不是图片");
			}
			else
				System.out.println("是图片");
			byte[] b = Base64.decodeBase64(str);
			System.out.println(b.length);//文件大小
	}
	
	public void test_base64_img() throws IOException
	{
		//data:image/jpg;base64,
		//	String str = "";
		//data:image/tif;base64,
		String str = "";
		byte[] b = Base64.decodeBase64(str);
		System.out.println(b.length);//文件大小
		StringBuilder stringBuilder = new StringBuilder();  
		for (int i = 0; i < b.length&&i<10; i++) {  
		    int v = b[i] & 0xFF;  
		    String hv = Integer.toHexString(v);  
		    if (hv.length() < 2) {  
		        stringBuilder.append(0);  
		    }  
		    stringBuilder.append(hv);  
		}
		System.out.println(stringBuilder.toString());
		
		InputStream is = new ByteArrayInputStream(Base64.decodeBase64(str));
//		Metadata metadata = JpegMetadataReader.readMetadata(is);
		@SuppressWarnings("deprecation")
		Metadata metadata = TiffMetadataReader.readMetadata(is, true);
		Directory exif = metadata.getDirectory(ExifIFD0Directory.class);
		System.out.println(exif.getDescription(ExifIFD0Directory.TAG_WIN_TITLE));
		
		Collection<Tag> tags = exif.getTags();
		  Iterator<Tag> iter = tags.iterator();
		  
		  // 逐个遍历每个Tag
		  while (iter.hasNext()) {
		   Tag tag = (Tag) iter.next();
		   System.out.println(tag);
		  }
	}
	
	public void test_base64_file() throws IOException
	{
		File f = new File("test.txt");
		FileInputStream in = new FileInputStream(f);
		byte[] by = new byte[2400];
		int size = 0;
		StringBuffer sbu = new StringBuffer();
		while((size = in.read(by, 0, 24)) != -1)
		{
			byte[] x = new byte[size];
			System.arraycopy(by, 0, x, 0, size);
			sbu.append(Base64.encodeBase64String(x));
		}
		String str = sbu.toString();
		System.out.println(str);
		if(!Base64.isBase64(str))
			System.out.println("不是base64编码！！！");
		else
			System.out.println("是base64编码");
		byte[] b = Base64.decodeBase64(str);
		FileOutputStream out = new FileOutputStream(new File("new.txt"));
		out.write(b);
		out.flush();
		out.close();
		in.close();
		System.out.println(b.length);//文件大小
	}
}
